export default class index extends React.Component {

    static async getInitialProps() {
        return {}
    }

    render() {
        return (
            <div>
                <div className="navBar"></div>

              
              
              
                <style global jsx>
                    {`
                        body {
                        background: coral;
                        margin: 0;
                        padding: 0;
                        border: 0;
                        }
                        .navBar{
                            height: 72px;
                            width: 100%;
                            background: white;

                        }
                    `}
                </style>

            </div>
        )

    }



}
